import React from 'react'
import { Button, Input } from '@material-ui/core';
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello</h1>
        <Input placeholder='Enter Todo'/>
        <Button type=''>Submit</Button>
      </header>
    </div>
  );
}

export default App;
